//channelId
//upcoming
//改善用threan
  //ch9 將所有workout顯示在home page//new
  useEffect(() => {
    const fetchData = async () => {
      const response = await fetch("/api/data");
      const json = await response.json();

      if (response.ok) {
        setDates(json);
        // console.log();
      }
    };
    //ch n15登入才向後端發請求

    fetchData();
  }, []); //ch n15登入才向後端發請求 //加上[]这令 useEffect只會在第一次觸發

  // ch n11  call useLogout function to delete the local storage
  const { logout } = useLogout();
  const handleClick = () => {
    logout();
  };
//youtude api


  return (
    <div className="NewHome">
      <div class="wrap">
        <div class="Navigation left">
          <h1> Youtude vidio list </h1>
          {dates &&
            dates.map((a) => (
              <p key={a._id}>{a.name}</p> //這行把资料顯示在web
            ))}
          <p>
            {" "}
            <i class="fa-brands fa-youtube"></i>streaming
          </p>
          <p>
            <i class="fa-brands fa-square-youtube"></i>upcoming
          </p>
          <p>
            <i class="fa-brands fa-twitter"></i>twitter
          </p>
        </div>
        <div class="right">
          {/* navbar */}
          <div className="right_navbar">
            {/* ch n13 then show user email in web */}

            <button onClick={handleClick}>Log out</button>
          </div>
          <div class="context">
            <h1>test</h1>
          </div>
          {/* <content/> */}
        </div>
      </div>
    </div>
  );
};
